/**
 * Show page
 * @function show
 * @param {string} url - URL to show
 * @returns {*}
 */
'use strict';

import get from './get';
/** show */

function show(url) {
  var location = get('location');

  if (!location) {
    console.warn("Failed to show because there no location object");
    return;
  }

  location.href = url;
}

export default show;
